/**
 * Extended Error object to signify a join meeting error
 */
export default class JoinMeetingError extends Error {
    code: any;
    error: any;
    joinOptions: any;
    sdkMessage: any;
    /**
     *
     * @constructor
     * @param {Object} [options]
     * @param {String} [message]
     * @param {Object} [error]
     */
    constructor(options?: object, message?: string, error?: any);
}
